  `category_id` smallint(6) unsigned NOT NULL DEFAULT '0' COMMENT '产品类别，0表示不确定',
  `full_name` varchar(255) NOT NULL DEFAULT '' COMMENT '全称',
  `short_name` varchar(120) NOT NULL COMMENT '简称',
  `creater` varchar(30) NOT NULL COMMENT '推荐人',
  `creater_uid` int(8) unsigned NOT NULL DEFAULT '0' COMMENT '推荐人uid(为当前操作用户的id,关联zb_user表)',
  `contact_tel` varchar(30) NOT NULL COMMENT '联系人的电话',
  `contacter` varchar(50) NOT NULL COMMENT '联系人',
  `channel_fee` varchar(255) NOT NULL COMMENT '渠道费用',
  `term` varchar(255) NOT NULL DEFAULT '' COMMENT '周期时长，0-0个月',
  `online_start_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '开始上线时间',
  `end_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '结束时间',
  `total_moeny` decimal(13,2) NOT NULL DEFAULT '0.00' COMMENT '产品总金额',
  `introduction` text COMMENT '简介',
  `law_remark` text COMMENT '法务意见',
  `fee_status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '费率状态 0-未进入费率阶段 1-未提交  2-已提交 3-未通过 4-已通过 ',
  `status` tinyint(4) unsigned NOT NULL DEFAULT '1' COMMENT '1未完成 2 待评分 3 合同待上传 4 合同待审核 5 产品待审核  6 销售中 7 已过期 8 被撤销, 9 被终止 10 暂下架 11 已下架 99 预录入',
  `add_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '添加时间',
  `update_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `full_name` (`full_name`),
  KEY `abbr_name` (`short_name`)
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=utf8 COMMENT='产品基本通用信息表';

