INSERT INTO `zb_category_group_field_value` VALUES ('414', '19', '24', '周边项目优势', '聊城国家经济技术开发区位于冀鲁豫三省交界处，有得天独厚的区位优势。既可凭借东部沿海的开放优势，又可以利用内陆省份的丰富资源。聊城是中国北方重要的能源基地，内陆口岸和辐射冀鲁豫交界地区的中心城市，是我国重要的交通枢纽，京九铁路、济邯铁路以济聊高速公路在此交汇，济聊高速公路向东与济青、京沪、京福高速公路，向西与京深、京珠高速公路相通。2013年3月聊城经济开发区升级为国家级经济技术开发区。 近年来聊城经开区经济总量及工业总产值保持较快增长，初步形成了七大产业园区，并有多家行业龙头企业入驻，工业经济初具规模，未来经济增长潜力较大近年来，聊城经开区经济保持快速发展。2012 年～2014 年，聊城经开区分别实现地区生产总值106.77 亿元、125.92 亿元和141.56 亿元，按可比价格计算，同比分别增长13.2%、10.1%和10.2%。2014 年，聊城经开区第一产业完成增加值10.81 亿元，同比下降0.38%；第二产业完成增加值72.82 亿元，同比增长8.05%；第三产业完成增加值52.93 亿元，同比增长22.95%；三次产业结构由2013 年的8.6： 57.2：34.2 调整为7.6：55.0：37.4。 聊城经开区工业经济已初具规模，初步形成了循环经济化工产业园、新能源汽车产业园、九州国际高科园、生物科技产业园、金属材料深加工产业园、现代物流园区、现代农业示范园等七大产业园区。2012 年～2014 年，聊城经开区工业总产值分别为317.57 亿元、331.38 亿元和376.95 亿元，同比分别增长19.2%、4.4%和13.75%。华润集团、韩国希杰集团等世界500 强企业先后落户聊城经开区，中通汽车工业集团、信发铝电集团、鲁西化工集团等多家行业龙头企业带动各产业园区迅速发展。其中，中通汽车工业集团建成首个国家级新能源客车实验室，2014年新能源客车销量及增幅均居全国第一；韩国希杰集团在聊城经开区生化食品医药产业领域已累计投资近4 亿美元。总体来看，聊城经开区未来经济发展潜力较大。', '2016-02-02 13:27:13', '1');
