INSERT INTO `zb_product_category_field_value` VALUES ('150', '18', '12', '项目简介', '本资产管理计划的委托财产以1：1.416的比例受让并持有瀚瑞投资转让的全部或部分标的应收账款，转让价款预计为人民币50000万元整。本资产管理计划的存续期预计为自运作起始日起24个月，资产管理人有权根据交易实际情况决定提前终止或延长本计划存续期限。资产管理人提前终止或延长本计划的，应通过网站公告的方式告知全体委托人。\n管理人与瀚瑞投资就标的应收账款的回购事宜签订《应收账款转让及回购合同》，约定自运作起始日起至运作起始日起满24个月之日期间，瀚瑞投资有义务对本计划实际受让的部分或全部标的应收账款进行回购。\n由瀚瑞投资的全资子公司镇江城投为新区管委会按照《应收账款转让及回购合同》履行还款义务提供连带保证责任担保。\n', '2016-02-02 13:16:30', '2016-02-02 13:56:55', '1');
