INSERT INTO `zb_product_category_field_value` VALUES ('160', '19', '10', '基金管理人简介', '上海歌迅金融服务股份有限公司（以下简称“歌迅金融/SGF”），应鼓励专业人员创办金融服务机构、支持实体经济发展的政策号召而立，由资深金融团队创办，为浦东新区首家金融服务股份公司。 \n团队带头人履职人民银行、信托公司、产业投资、金融服务30年，历任科长、处长、副总经理、总经理、董事长，一路规范稳健，专业尽责，深孚众望。团队成员均出身名校，金融从业15年以上。团队最为重要的经验在资产管理，资管的技能优势是歌迅金融服务客户、立足市场的核心竞争力。 \n      中国的金融投资即将回到常识，回到本质。机会型交易还是价值投资，刚性兑付还是风险定价，认机构还是认能力，终将由市场决定。现在起，市场进入资产为王时代。每一位投资者，每一份财富，投什么，怎么投，都由收益与风险所归结的资产说了算。这方面，歌迅团队过往的实践、记录和坚守，足以让人欣慰。实施资产管理的是歌迅金融旗下上海歌迅资产管理有限公司（简称“歌迅资管”）。 \n       成熟的资产管理要求实现客户、产品、销售的整体贯通和相互促进。歌迅金融和歌迅资管出资设立上海歌迅财富管理有限公司，正是融合产品制作与销售、更好服务线下高净值客户的体系化安排。 \n而歌迅金融致力塑造领先的金融服务机构，必须以分众的客群定位提供互联网理财服务，以满足1千元至100 万元之间的投资理财需求，践行普惠金融服务的宗旨。以优异的资产管理能力和优质的资产为依托，依然是歌迅金融互联网理财的根本出发点，令一般净值的投资者同等享受高净值投资者的资产配置，安全、高效用的投资服务。 \n       歌迅金融注册资本1亿元，由团队持股平台联合实业界人士合作创立。近期将引入上市公司股东。作为股份公司，歌迅金融《公司章程》、三会《议事规则》按照股转系统规则设立，以确保公司自设立起即执行严谨规范的治理标准，体现金融服务企业受托尽责的本质要求。为彰显这一要求，公司延请名望卓著的资深专家担任独立董事，更好地为，客户负责，为股东会负责。 \n以上海歌迅金融服务股份有限公司为主平台，上海歌迅资产管理有限公司、上海歌迅财富管理有限公司、上海歌迅金融信息服务有限公司为分平台，歌迅金融设立资产管理中心、财富管理中心、互联网理财中心三大业务群，设财务与运营、风控、综管三个经营支持板块。以构建完整的业务链和独立而协同的前中后台。 \n      歌迅金融依据国家法律法规和政策经营业务，恪守“受人之托，代人理财”的准则，忠于受托职责，善尽管理义务，始终做受尊重的投融资专家和财富管理伙伴。', '2016-02-02 13:19:07', '2016-02-02 13:27:13', '1');
