INSERT INTO `zb_product_category_field_value` VALUES ('162', '19', '12', '项目简介', '兴业经开主要负责聊城经济开发区城市基础设施建设以及公用事业运行等，承担着“城市建设、土地整理、房产置业、旅游开发”为主业，业务涉及城市基础设施建设、土地综合开发利用、旧城区拆迁改造、房地产开发、物业管理经营、文化旅游开发、公共服务设施经营、新农村建设、矿产资源开发等多个领域，为了解决企业生产过程中的流动性需求，兴业经开向我司发出融资请求，拟融资3.5亿元用于满足企业流动性需求。兴业经开对兖州财政局BT项目应收账款余额30000-40000万元中对应相应债权金额的应收账款并到期溢价回购。', '2016-02-02 13:19:07', '2016-02-02 13:27:13', '1');
