INSERT INTO `zb_product_category_field_value` VALUES ('171', '20', '9', '项目风控', '1.	项目公司将项目土地及在建工程抵押给基金或基金指定金融机构，抵押率不高于50%\n2.	秀兰集团将持有的项目公司100%股权质押\n3.	秀兰集团为项目公司偿还借款本息提供无限连带责任担保\n4.	秀兰集团公司实际控制人郝海玲、康雨为项目公司偿还借款本息提供无限连带责任担保\n5.	基金委派董事和财务副总监，董事对项目重大事项有一票否决权；项目资金封闭使用。\n6.	秀兰集团旗下其他两家有实力的项目公司提供担保。\n', '2016-02-03 12:10:28', '2016-02-03 13:37:15', '1');
INSERT INTO `zb_product_category_field_value` VALUES ('172', '20', '10', '基金管理人简介', '本基金实际管理人为嘉兴鼎信的100%控股股东---鼎信长城基金\n鼎信长城基金成立于2012年，注册资金1000万元，是由长城国融和北京鼎信智赢股权投资管理有限公司共同出资组建，是专门从事房地产私募股权投资基金投资、管理并提供相关资讯服务的房地产基金管理公司。长城国融由长城资产控股，为鼎信长城基金股东，占股30%。\n截止目前，鼎信长城基金投资规模近300亿，存续管理规模约120亿，2014年新增投资80亿，房地产金融业务线投中集团评为“2014年度最佳产业基金top5\"，被清科集团评为”2014年度最佳房地产基金“前三强。', '2016-02-03 12:10:28', '2016-02-03 13:37:15', '1');
INSERT INTO `zb_product_category_field_value` VALUES ('173', '20', '11', '投资顾问简介', '本基金实际管理人为嘉兴鼎信的100%控股股东---鼎信长城基金\n鼎信长城基金成立于2012年，注册资金1000万元，是由长城国融和北京鼎信智赢股权投资管理有限公司共同出资组建，是专门从事房地产私募股权投资基金投资、管理并提供相关资讯服务的房地产基金管理公司。长城国融由长城资产控股，为鼎信长城基金股东，占股30%。\n截止目前，鼎信长城基金投资规模近300亿，存续管理规模约120亿，2014年新增投资80亿，房地产金融业务线投中集团评为“2014年度最佳产业基金top5\"，被清科集团评为”2014年度最佳房地产基金“前三强。', '2016-02-03 12:10:28', '2016-02-03 13:37:15', '1');
INSERT INTO `zb_product_category_field_value` VALUES ('174', '20', '12', '项目简介', '秀兰-左岸小镇项目是秀兰集团在河北香河开发的深度绿化公园中高端住宅项目，项目总占地面积为1100亩，其中建设用地550亩，配套用地550亩，目前项目一期、二期已开发并销售完毕，本次融资的是项目三期、四期和五期，其中三期、四期土地证已取得，三期在建到地上七层，五期土地证于2016年初取得。三四五期的楼面地价为1590元/平米。', '2016-02-03 12:10:28', '2016-02-03 13:37:15', '1');
