INSERT INTO `zb_product_score_reason` VALUES ('15', '19', '105', '聊城兴业经开对聊城市经开区政府的债权在中国人民银行征信中心动产质押登记系统转让登记并债权公示；聊城市开发区财政局确认本次融资所对应的债务为政府承担还本付息责任的存量限额债务，并出具承诺函将所负债务及担保义务列入财政预算；该公司及其担保公司在银行系统中未发现不良贷款记录，且在法院被执行查询系统中均未有被执行情况；开发项目陆续收到政府回款，运作良好；本次推荐期限为三个月的短期产品，流动性好，风险较小。', '2016-02-03 11:02:10', '1', '1');
